import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import React from 'react';

import '../Styles/navstyle.css';

const Nava = () => {
  return (
    <Navbar variant="dark" className="me-auto bg-body-tertiary" expand="lg">
      <Container>
        <Navbar.Brand className="mb-3">Project</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav defaultActiveKey="/Home" className="flex-column me-auto">
            <Nav.Link href="/Home">Home</Nav.Link>
            <Nav.Link href="/New">New reg</Nav.Link>
            <Nav.Link href="/ToDoList">ToDoList</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Nava;
